INSERT INTO `eb_pay_component_cat` VALUES (1120, '蔬菜/菌类', '1、国产商品：四选一①《农作物种子生产经营许可证》②《林木种子生产经营许可证》④《种子的备案登记》和授权人的《种子生产经营许可证》（若备案登记中不包含种子的目录，还须提供授权人授权的《种子的目录》） 2、进口商品需提供：①《种子经营许可证》；②进口商的进出口贸易资格证；③《出入境检验检疫证明》或《出入境检验检疫卫生证书》；④供货协议或采购合同等材料。 （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 1, '', 0, 1115, '种子', 1069, '农资园艺');
INSERT INTO `eb_pay_component_cat` VALUES (1122, '土壤调理剂', '1、国产商品需提供：①《全国工业生产许可证》（生产许可证正本和副本，需含有复合肥、磷肥项；高浓度复合肥、尿素、二铵、钾肥等单质肥料、有机肥、水溶肥不需要提供）；②供货协议或采购合同等材料。 2、进口商品需提供：①近一年内的中华人民共和国海关进口货物报关单；②《出入境检验检疫证明》或《出入境检验检疫卫生证书》（检疫证明或卫生证书需与报关单的合同协议号一致、且报关单应展现对应品牌名称及商品名称）；③供货协议或采购合同等材料。 （注：若申请主体为生产商或是办理出入境检验证或报关单的收货人，则无需提供供货协议或采购合同等材料）', 1, '肥料产品正式/临时登记证（国家规定免予登记的除外）', 2, 1121, '肥料', 1069, '农资园艺');
