INSERT INTO `eb_pay_component_cat` VALUES (6667, '海鲜卡券', '需提供：1、申请主体的发卡方单用途预付卡备案的证明文件； 2、发卡企业向备案机关提交的包含该入驻商家（售卡单位）的售卡企业清单及承诺函（入驻商家为发卡方无需提供此项）； 3、经营水产品的养殖证明/进货渠道证明（如：授权）；4、经营阳澄湖大闸蟹卡券的特殊要求：《农产品地理标志登记证书》登记申请人协会对商家主体的授权(只限一级)', 1, ' （选填）1、若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件； 2、标记农产品产地的农产品，需提供《农产品地理标志登记证书》； 3、声称获得无公害农产品认证的农产品，需提供《无公害农产品认证证书》； 4、声称获得绿色食品认证的食品，需提供《绿色食品证书》； 5、声称获得有机食品认证的食品，需提供《有机产品认证证书》', 2, 6661, '海鲜水产', 6625, '生鲜');
INSERT INTO `eb_pay_component_cat` VALUES (6668, '藻类', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, ' （选填）1、若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件； 2、标记农产品产地的农产品，需提供《农产品地理标志登记证书》； 3、声称获得无公害农产品认证的农产品，需提供《无公害农产品认证证书》； 4、声称获得绿色食品认证的食品，需提供《绿色食品证书》； 5、声称获得有机食品认证的食品，需提供《有机产品认证证书》', 2, 6661, '海鲜水产', 6625, '生鲜');
