INSERT INTO `eb_pay_component_cat` VALUES (6681, '其他禽类', '1、国产商品需提供：①《动物防疫条件合格证》；②供货协议或采购合同等材料。 2、进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料。 （注：若申请主体为养殖供货方或是办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 1, ' （选填）1、若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件； 2、标记农产品产地的农产品，需提供《农产品地理标志登记证书》； 3、声称获得无公害农产品认证的农产品，需提供《无公害农产品认证证书》； 4、声称获得绿色食品认证的食品，需提供《绿色食品证书》； 5、声称获得有机食品认证的食品，需提供《有机产品认证证书》', 2, 6680, '禽肉蛋品', 6625, '生鲜');
INSERT INTO `eb_pay_component_cat` VALUES (6682, '蛋类', '1、国产商品需提供：①《动物防疫条件合格证》；②供货协议或采购合同等材料。 2、进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料。 （注：若申请主体为养殖供货方或是办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 1, ' （选填）1、若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件； 2、标记农产品产地的农产品，需提供《农产品地理标志登记证书》； 3、声称获得无公害农产品认证的农产品，需提供《无公害农产品认证证书》； 4、声称获得绿色食品认证的食品，需提供《绿色食品证书》； 5、声称获得有机食品认证的食品，需提供《有机产品认证证书》', 2, 6680, '禽肉蛋品', 6625, '生鲜');
