INSERT INTO `eb_pay_component_cat` VALUES (7474, '饼干蛋糕', '需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料；若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料。 （注：自贸区企业若无法提供《食品经营许可证》，需提供营业执照（经营范围需包含食品经营（预包装食品））', 1, '', 0, 7463, '进口食品', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (7476, '卡券', '1、申请主体的《食品经营许可证》或《食品生产许可证》 或《预包装食品销售备案凭证》；2、发卡方单用途预付卡备案的证明文件；3、发卡企业向备案机关提交的包含该入驻商家（售卡单位）的售卡企业清单及承诺函（入驻商家为发卡方无需提供此项）。 （注：自贸区企业若无法提供《食品经营许可证》，需提供营业执照（经营范围需包含食品经营（预包装食品））', 1, ' （选填）1、若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件； 2、标记农产品产地的农产品，需提供《农产品地理标志登记证书》； 3、声称获得无公害农产品认证的农产品，需提供《无公害农产品认证证书》； 4、声称获得绿色食品认证的食品，需提供《绿色食品证书》； 5、声称获得有机食品认证的食品，需提供《有机产品认证证书》', 2, 7475, '食品礼券', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (7477, '月饼', '1、申请主体的《食品经营许可证》或《食品生产许可证》 或《预包装食品销售备案凭证》；2、发卡方单用途预付卡备案的证明文件；3、发卡企业向备案机关提交的包含该入驻商家（售卡单位）的售卡企业清单及承诺函（入驻商家为发卡方无需提供此项）。 （注：自贸区企业若无法提供《食品经营许可证》，需提供营业执照（经营范围需包含食品经营（预包装食品））', 1, ' （选填）1、若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件； 2、标记农产品产地的农产品，需提供《农产品地理标志登记证书》； 3、声称获得无公害农产品认证的农产品，需提供《无公害农产品认证证书》； 4、声称获得绿色食品认证的食品，需提供《绿色食品证书》； 5、声称获得有机食品认证的食品，需提供《有机产品认证证书》', 2, 7475, '食品礼券', 7419, '食品饮料');
