INSERT INTO `eb_pay_component_cat` VALUES (377091, '家政保洁', '《营业执照》经营范围包含家政服务等相关项目', 1, '1、服务内容标准化，商品必须完整描述服务名称，具体包含的服务内容，商品详情须明确描述有效期，使用注意事项等内容； 2、服务内容若包含高空清洗服务还需提供《高空清洗悬吊作业企业安全生产证书》； 3、提供服务的商家需与小商店主体一致。', 2, 377101, '家政', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (377102, '家电维修', '《营业执照》经营范围包含家政服务等相关项目', 1, '1、服务内容标准化，商品必须完整描述服务名称，具体包含的服务内容，商品详情须明确描述有效期，使用注意事项等内容； 2、提供服务的商家需与小商店主体一致。', 2, 377101, '家政', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (377104, '安装服务', '需提供：1、住建部颁发的工程设计与施工资质相应等级证书（主要含室内装修、装饰范围）；2、各级建设厅颁发的相应的建筑业企业资质证书；3、经营装修施工需拥有3个（含）以上实体门店，上传门店的门头照片； 注：营业执照：加载“统一社会信用代码”的营业执照，经营整体全包、整体半包需公司注册满2年，注册资金200万（含）以上，其他类目需公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 377103, '装修服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (377105, '装修监理', '需提供：1、住建部颁发的工程设计与施工资质相应等级证书（主要含室内装修、装饰范围）；2、各级建设厅颁发的相应的建筑业企业资质证书；3、工程监理需提供建设部或中国室内装饰协会（含地区性装饰协会）颁发的工程监理资质证书； 注：营业执照：加载“统一社会信用代码”的营业执照且公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 377103, '装修服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (377106, '装修设计', '需提供（2选1）： 1、各级装饰协会颁发的室内装饰企业资质等级证书等证明文件； 2、提供五套设计案例，每套设计案例需包含以下四项资质：①案例家具平面布置图、地面铺装图、顶面设计图；②至少三张不同空间的效果图；③完工案例实景照片至少五张；④案例基础信息：项目地址、户型、面积、造价、项目介绍（风格、思路、灵感等）（word格式）。 注：营业执照：加载“统一社会信用代码”的营业执照且需公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 377103, '装修服务', 377078, '生活服务');
