INSERT INTO `eb_pay_component_cat` VALUES (379006, '中小学课外辅导', '1、如提供线下中小学学科教育：需提供申请主体的《民办学校办学许可证》；2、如提供中小学学科线上服务：需提供申请主体的全国校外线上培训管理服务平台备案', 1, '', 0, 383005, '青少年素质教育', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (379009, '会计考试培训', '1、线下授课：提供申请主体的人力资源社会保障部门批准的文件或《民办学校办学许可证》 2、线上授课：①需提供申请主体的ICP备案（网络内容提供商备案）或ICP许可证；②提供申请主体的人力资源社会保障部门批准的文件或《民办学校办学许可证》', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (382005, '青少年素质培养', '需提供申请主体的《营业执照》（经营范围需包含相关内容）', 1, '', 0, 383005, '青少年素质教育', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (420002, '时政新闻', '需提供申请主体的《报纸出版许可证》', 1, '', 0, 429006, '报纸', 135835, '图书');
INSERT INTO `eb_pay_component_cat` VALUES (420003, '整体全包', '需提供：1、住建部颁发的工程设计与施工资质相应等级证书（主要含室内装修、装饰范围）；2、各级建设厅颁发的相应的建筑业企业资质证书；3、经营装修施工需拥有3个（含）以上实体门店，上传门店的门头照片； 注：营业执照：加载“统一社会信用代码”的营业执照，经营整体全包、整体半包需公司注册满2年，注册资金200万（含）以上，其他类目需公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 377103, '装修服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (421001, '差价', '', 0, '商品信息中需说明是哪款商品的补差价链接', 2, 430005, '差价', 429008, '其他');
INSERT INTO `eb_pay_component_cat` VALUES (421002, '酒店套餐', '1、若为单体酒店需提供：①《卫生许可证 》；②《特种行业许可证》；③如涉及自助餐券需提交餐饮服务许可（如已三证合一可提交食品经营许可）。2、若为酒店集团需提供：①集团旗下一家酒店的资质（同单体酒店）；②集团与该提供资质的酒店间的管理关系证明并附集团旗下所有酒店名单。3、若为旅行社需提供：（1）总社需提供：①《旅行社经营许可证》；②《旅行社责任险保险单》；（2） 分社需提供：①《分社备案登记证明》；②《旅行社责任险保险单》（保险若为总社统一购买请提供总社的《旅行社责任险保险单》）；③总社的《旅行社业务经营许可证》。4、若为非旅行社（酒店代理商）需提供：资质担保书或与酒店合作协议。', 1, '', 0, 435005, '酒店预订', 128209, '旅游休闲');
INSERT INTO `eb_pay_component_cat` VALUES (422001, '缓解疲劳', '需提供申请主体的《食品经营许可证》（经营项目包含保健食品销售）或《食品生产许可证》（食品类别包含保健食品）； （注：自贸区企业若无法提供《食品经营许可证》，需提供营业执照（经营范围需包含保健食品销售））', 1, '根据相关法律法规及平台运营规则，经营此类商品需提供《国产保健食品批准证书》或《进口保健食品批准证书》', 1, 378089, '保健食品', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (422002, '其他滋补品', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, '若经营单一的且未经炮制、加工的中药材类初级农产品须符合以下要求： ①商品外包装须符合《农产品包装和标识管理办法》的规定，应当在包装物上标注或者附加标识标明品名、产地、生产者或者销售者名称、生产日期;②需在商品详情处自我声明不属于中药饮片，不得替代中药饮片作临床调剂和中成药原料使用。', 2, 378091, '传统滋补', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (422003, '其他兴趣生活', '', 0, '', 0, 378005, '生活兴趣', 381003, '教育培训');
