INSERT INTO `eb_pay_component_cat` VALUES (422006, '疫苗 ', '需提供申请主体的《兽药经营许可证》或《兽药生产许可证》', 1, '1、国产：外包装照片，显示兽药的通用名称、成分、生产企业、产品批准文号产品批号、生产日期、有效期；2、 进口：外包装照片，显示兽药的通用名称、成分、生产企业、进口兽药注册证号，产品批号、生产日期、有效期证', 1, 422005, '宠物医疗', 1208, '宠物生活');
INSERT INTO `eb_pay_component_cat` VALUES (422007, '艺术展览', '', 0, '主办方：《营业执照》含相关范围； 代理方：提供主办方的授权文件+主办方的营业执照', 1, 428007, '本地玩乐', 128209, '旅游休闲');
