INSERT INTO `eb_pay_component_cat` VALUES (427004, '装修设计', '需提供（2选1）： 1、各级装饰协会颁发的室内装饰企业资质等级证书等证明文件； 2、提供五套设计案例，每套设计案例需包含以下四项资质：①案例家具平面布置图、地面铺装图、顶面设计图；②至少三张不同空间的效果图；③完工案例实景照片至少五张；④案例基础信息：项目地址、户型、面积、造价、项目介绍（风格、思路、灵感等）（word格式）。 注：营业执照：加载“统一社会信用代码”的营业执照且需公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 442007, '装修服务', 1701, '家装建材');
