INSERT INTO `eb_pay_component_cat` VALUES (430008, '国内酒店', '1、若为单体酒店需提供：①《卫生许可证 》；②《特种行业许可证》；③如涉及自助餐券需提交餐饮服务许可（如已三证合一可提交食品经营许可）。2、若为酒店集团需提供：①集团旗下一家酒店的资质（同单体酒店）；②集团与该提供资质的酒店间的管理关系证明并附集团旗下所有酒店名单。3、若为旅行社需提供：（1）总社需提供：①《旅行社经营许可证》；②《旅行社责任险保险单》；（2） 分社需提供：①《分社备案登记证明》；②《旅行社责任险保险单》（保险若为总社统一购买请提供总社的《旅行社责任险保险单》）；③总社的《旅行社业务经营许可证》。4、若为非旅行社（酒店代理商）需提供：资质担保书或与酒店合作协议。', 1, '', 0, 435005, '酒店预订', 128209, '旅游休闲');
