INSERT INTO `eb_pay_component_cat` VALUES (431001, '骨骼健康', '需提供申请主体的《食品经营许可证》（经营项目包含保健食品销售）或《食品生产许可证》（食品类别包含保健食品）； （注：自贸区企业若无法提供《食品经营许可证》，需提供营业执照（经营范围需包含保健食品销售））', 1, '根据相关法律法规及平台运营规则，经营此类商品需提供《国产保健食品批准证书》或《进口保健食品批准证书》', 1, 378089, '保健食品', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (431002, '藿香', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, '若经营单一的且未经炮制、加工的中药材类初级农产品须符合以下要求： ①商品外包装须符合《农产品包装和标识管理办法》的规定，应当在包装物上标注或者附加标识标明品名、产地、生产者或者销售者名称、生产日期;②需在商品详情处自我声明不属于中药饮片，不得替代中药饮片作临床调剂和中成药原料使用。', 2, 378091, '传统滋补', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (431004, '监理服务', '需提供：1、住建部颁发的工程设计与施工资质相应等级证书（主要含室内装修、装饰范围）；2、各级建设厅颁发的相应的建筑业企业资质证书；3、工程监理需提供建设部或中国室内装饰协会（含地区性装饰协会）颁发的工程监理资质证书； 注：营业执照：加载“统一社会信用代码”的营业执照且公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 442007, '装修服务', 1701, '家装建材');
