INSERT INTO `eb_pay_component_cat` VALUES (442008, '局部装修', '需提供：1、住建部颁发的工程设计与施工资质相应等级证书（主要含室内装修、装饰范围）；2、各级建设厅颁发的相应的建筑业企业资质证书；3、经营装修施工需拥有3个（含）以上实体门店，上传门店的门头照片； 注：营业执照：加载“统一社会信用代码”的营业执照，经营整体全包、整体半包需公司注册满2年，注册资金200万（含）以上，其他类目需公司注册满2年，注册资金100万（含）以上。', 1, '', 0, 377103, '装修服务', 377078, '生活服务');
