INSERT INTO `eb_pay_component_cat` VALUES (468002, '预约服务', '1、需提供申请主体的《营业执照》（需包含家具经营范围）；2、请上传线下门店照片', 1, '（选填） 请说明预约服务具体规则，并在商品详情中标注（规则需明确到店后，如不产生消费，不增收费用）', 2, 1363, '定制家具', 1247, '家具');
INSERT INTO `eb_pay_component_cat` VALUES (469001, '预约服务', '1、如主体为房产开发商需提供《营业执照》（经营范围需包含房地产开发）； 2、如主体为房产中介机构需提供《营业执照》（经营范围需包含房地产中介/经济服务）', 1, '1.房产开发商需提供所展示楼盘的《商品房预售许可证》或《商品房销售许可证》（主体名应与证件主体一致）； 2.房产中介需提供当地政府的备案公示 ；3.商品为预约服务类型，请说明具体规则。', 1, 468001, '房地产', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (477001, '汽车试驾', '1、如主体为汽车厂商需提供《营业执照》和《工信部道路机动车辆生产企业准入许可》； 2、如主体为汽车经销商/4s店需提供《营业执照》和《厂商授权销售文件》与《工信部道路机动车辆生产企业准入许可》； 3、如主体为下属子/分公司需提供《营业执照》、《工信部道路机动车辆生产企业准入许可》与《股权关系证明函》（含双方盖章）； 注：需提供线下门店照片', 1, '（选填）请说明试驾具体规则，并在商品详情中标注（规则需明确仅试驾不增收其他费用）', 2, 378068, '汽车服务', 6263, '汽车');
INSERT INTO `eb_pay_component_cat` VALUES (480001, '权益券', '1、如主体为房地产开发商：①需提供《营业执照》（经营范围需包含房地产开发）；②房地产开发资质等级证书或房地产开发企业暂定资质证书； 2、如主体为非房地产开发商：①需提供与开发商之间的合作协议（如：授权书）；②开发商的房地产开发资质等级证书或房地产开发企业暂定资质证书；③开发商的《营业执照》（经营范围需包含房地产开发）', 1, '1、如主体为房地产开发商需要在商品详情处展示楼盘的《商品房预售许可证》或《商品房销售许可证》； 2、如主体非房地产开发商①需要提供与开发商之间的合作协议（如：授权书）；②需要在商品详情展处示对应合作楼盘的《商品房预售许可证》或《商品房销售许可证》', 1, 468001, '房地产', 377078, '生活服务');
