INSERT INTO `eb_pay_component_cat` VALUES (494045, '羊蝎子', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, '（选填）若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件', 2, 527038, '半成品菜/方便菜', 6625, '生鲜');
INSERT INTO `eb_pay_component_cat` VALUES (494046, '健身健美', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 378005, '生活兴趣', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (494047, '韩语', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 517051, '语言培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (494048, '学历/职业考试线下', '1、2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校） 2、如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 530065, '本地教育培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (494049, '早教中心', '1、《民办学校办学许可证》 2、 2选1：① 营业执照，业务范围（或经营范围）中应包含“儿童教育”“学前教育”等；②《民办非企业单位法人证书》。 3、若涉及餐饮服务提供的，需提供《食品经营许可证》。 4、早教中心场地证明（场地和校舍产权证明或合法规范的租赁协议书）及门店照。', 1, '', 0, 530065, '本地教育培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (496026, '芝麻丸', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, '若经营单一的且未经炮制、加工的中药材类初级农产品须符合以下要求： ①商品外包装须符合《农产品包装和标识管理办法》的规定，应当在包装物上标注或者附加标识标明品名、产地、生产者或者销售者名称、生产日期;②需在商品详情处自我声明不属于中药饮片，不得替代中药饮片作临床调剂和中成药原料使用。', 2, 378091, '传统滋补', 7419, '食品饮料');
INSERT INTO `eb_pay_component_cat` VALUES (496027, '餐饮优惠/兑换券', '餐饮店主体： 需提供申请主体的《食品经营许可证》（经营范围需含餐饮制作相关项目）扫描件。 非餐饮店主体： 需提供：①《餐饮平台与门店的管理关系声明》;②《微信小商店餐饮门店运营资质和责任承诺函》（含旗下所以门店名单）;③卡券使用门店的《食品经营许可证》（经营范围需含餐饮制作）扫描件', 1, '', 0, 527035, '餐饮', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (496029, '男士须后水', '1、如主体为生产商，售卖国内商品需提供：①《化妆品生产许可证》； 2、如主体为进口商，售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料； （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '国产：国产非特殊用途化妆品备案（网上备案的电子凭证）或者国产特殊用途化妆品卫生许可批件； 进口：进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 1, 6871, '男士面部护肤', 6870, '美妆护肤');
