INSERT INTO `eb_pay_component_cat` VALUES (496032, '足部护理', '售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料。 （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '（选填）若为国产特殊用途化妆品，需提供国产特殊用途化妆品卫生许可批件； 若为进口化妆品，需提供进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 2, 1046, '身体护理', 1001, '个人护理');
