INSERT INTO `eb_pay_component_cat` VALUES (502003, '私人定制游', '1、旅行社总社需提供：①《旅行社业务经营许可证》；②旅行社责任险保险单 。 2、旅行社分社需提供：①旅行社分社备案登记证明； ②旅行社责任险保险单（若为总社统一购买提供总社旅行社责任险保险单）；③总社的《旅行社业务经营许可证》； ④旅行社分社和总社补充协议（如：由总社出具的知情同意责任书）。 3、旅行社若经营“境外一日游/多日游”“潜水”、“境外玩乐套餐”、“接送（机场/点对点/拼车）”类目，除提供上述资质外，还须提供至少一份与实际服务提供方的有效合作协议', 1, '', 0, 525002, '旅游度假', 128209, '旅游休闲');
INSERT INTO `eb_pay_component_cat` VALUES (502005, '定金', '1、如主体为汽车厂商需提供《营业执照》和《工信部道路机动车辆生产企业准入许可》； 2、如主体为汽车经销商/4s店需提供《营业执照》和《厂商授权销售文件》与《工信部道路机动车辆生产企业准入许可》； 3、如主体为下属子/分公司需提供《营业执照》、《工信部道路机动车辆生产企业准入许可》与《股权关系证明函》（含双方盖章）； 注：需提供线下门店照片', 1, '请商详中说明定金具体规则，并在商品标题中注明（定金）', 2, 378068, '汽车服务', 6263, '汽车');
INSERT INTO `eb_pay_component_cat` VALUES (502006, '专车', '需提供申请主体的《网络预约出租汽车经营许可证》', 1, '', 0, 521002, '打车（网约车）', 530004, '出行与交通');
INSERT INTO `eb_pay_component_cat` VALUES (502007, '流量充值', '运营商主体：需提供《基础电信业务经营许可证》 非运营商主体：提供运营商（移动、联通、电信）的代理合同或合作协议等正规渠道证明（协议需含代理范围/代理产品）', 1, '', 0, 1966, '通信服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (502009, '金条', '1、需提供申请主体《营业执照》（经营范围包括销售黄金制品等） 2、需提供1款由国/省/市级质监局或同级别检测机构出具的完整的相关质检/检测报告。报告需包含：① CMA或CNAS标识；② 商标/商品图、检测单位、商品成分各含量鉴定结论', 1, '商品介绍应当对可能存在的风险以及风险责任承担有合理提示或者警示，不得对收益或者与其相关的情况作出保证性承诺，不得利用学术机构、行业协会、专业人士、受益者的名义或者形象作推荐、证明', 2, 378137, '黄金', 378136, '珠宝首饰');
