INSERT INTO `eb_pay_component_cat` VALUES (502044, '菌/菇/酵素', '需提供： 1、 《食品经营许可证》或《预包装食品销售备案凭证》。 2、① 报关单：需提供近一年内的中华人民共和国海关进口货物报关单，报关单上应展现对应品牌名称，及商品名称；（若报关单上的经营使用单位或收货单位不在授权链上，需同时提供委托进口协议）；② 入境货物检验检疫证明：需提供与报关单合同协议号一致的检验检疫证明。', 1, '1、2选1：①  需提供生产商在当地质量技术监督局进行的食品安全企业标准备案，证明产品可以普通食品身份进入市场。② 《进口保健食品批准证书》 2、如涉及特殊用途膳食用食品的，需提供《国产特殊医学用途配方食品批准证书》或《婴儿配方乳粉注册证书》。 特殊用途膳食用食品：指涉及医学用途或婴幼儿配方的食品。', 1, 530056, '海外膳食营养补充食品', 502043, '膳食营养补充食品');
INSERT INTO `eb_pay_component_cat` VALUES (502045, '植物精华/提取物', '需提供： 1、 《食品经营许可证》或《预包装食品销售备案凭证》。 2、① 报关单：需提供近一年内的中华人民共和国海关进口货物报关单，报关单上应展现对应品牌名称，及商品名称；（若报关单上的经营使用单位或收货单位不在授权链上，需同时提供委托进口协议）；② 入境货物检验检疫证明：需提供与报关单合同协议号一致的检验检疫证明。', 1, '1、2选1：①  需提供生产商在当地质量技术监督局进行的食品安全企业标准备案，证明产品可以普通食品身份进入市场。② 《进口保健食品批准证书》 2、如涉及特殊用途膳食用食品的，需提供《国产特殊医学用途配方食品批准证书》或《婴儿配方乳粉注册证书》。 特殊用途膳食用食品：指涉及医学用途或婴幼儿配方的食品。', 1, 530056, '海外膳食营养补充食品', 502043, '膳食营养补充食品');
INSERT INTO `eb_pay_component_cat` VALUES (502046, '烹饪烘焙小吃餐饮培训', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、若涉及学历、技能证书，需提供2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (502047, '财务/会计培训', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (502048, '法语', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 517051, '语言培训', 381003, '教育培训');
