INSERT INTO `eb_pay_component_cat` VALUES (508001, '国内旅游', '1、旅行社总社需提供：①《旅行社业务经营许可证》；②旅行社责任险保险单 。 2、旅行社分社需提供：①旅行社分社备案登记证明； ②旅行社责任险保险单（若为总社统一购买提供总社旅行社责任险保险单）；③总社的《旅行社业务经营许可证》； ④旅行社分社和总社补充协议（如：由总社出具的知情同意责任书）。 3、旅行社若经营“境外一日游/多日游”“潜水”、“境外玩乐套餐”、“接送（机场/点对点/拼车）”类目，除提供上述资质外，还须提供至少一份与实际服务提供方的有效合作协议', 1, '', 0, 525002, '旅游度假', 128209, '旅游休闲');
