INSERT INTO `eb_pay_component_cat` VALUES (517005, '宽带新装', '运营商主体：需提供《基础电信业务经营许可证》 非运营商主体：①提供与市级以上移动运营商（电信/联通需提供省级以上）的代理合同或合作协议等正规渠道证明②提供合作协议对应运营商授权认证的《网络销售与实名制授权书》③提供合作协议对应运营商统一配发的授权防伪二维码标识④最近6个月在对应省份的宽带竣工订单数量数据表且加盖运营商部门章，或运营商出具的宽带竣工订单数量证明函', 1, '', 0, 1966, '通信服务', 377078, '生活服务');
