INSERT INTO `eb_pay_component_cat` VALUES (517045, '海洋生物类', '需提供： 1、 《食品经营许可证》或《预包装食品销售备案凭证》。 2、① 报关单：需提供近一年内的中华人民共和国海关进口货物报关单，报关单上应展现对应品牌名称，及商品名称；（若报关单上的经营使用单位或收货单位不在授权链上，需同时提供委托进口协议）；② 入境货物检验检疫证明：需提供与报关单合同协议号一致的检验检疫证明。', 1, '1、2选1：①  需提供生产商在当地质量技术监督局进行的食品安全企业标准备案，证明产品可以普通食品身份进入市场。② 《进口保健食品批准证书》 2、如涉及特殊用途膳食用食品的，需提供《国产特殊医学用途配方食品批准证书》或《婴儿配方乳粉注册证书》。 特殊用途膳食用食品：指涉及医学用途或婴幼儿配方的食品。', 1, 530056, '海外膳食营养补充食品', 502043, '膳食营养补充食品');
INSERT INTO `eb_pay_component_cat` VALUES (517046, '脂肪酸/脂类', '需提供： 1、 《食品经营许可证》或《预包装食品销售备案凭证》。 2、① 报关单：需提供近一年内的中华人民共和国海关进口货物报关单，报关单上应展现对应品牌名称，及商品名称；（若报关单上的经营使用单位或收货单位不在授权链上，需同时提供委托进口协议）；② 入境货物检验检疫证明：需提供与报关单合同协议号一致的检验检疫证明。', 1, '1、2选1：①  需提供生产商在当地质量技术监督局进行的食品安全企业标准备案，证明产品可以普通食品身份进入市场。② 《进口保健食品批准证书》 2、如涉及特殊用途膳食用食品的，需提供《国产特殊医学用途配方食品批准证书》或《婴儿配方乳粉注册证书》。 特殊用途膳食用食品：指涉及医学用途或婴幼儿配方的食品。', 1, 530056, '海外膳食营养补充食品', 502043, '膳食营养补充食品');
INSERT INTO `eb_pay_component_cat` VALUES (517047, '蛋白粉/氨基酸/胶原蛋白', '需提供： 《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》；注：自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品））', 1, '1、2选1：①  需提供生产商在当地质量技术监督局进行的食品安全企业标准备案，证明产品可以以普通食品身份进入市场。② 《国产保健食品批准证书》 2、如涉及特殊用途膳食用食品的，需提供《国产特殊医学用途配方食品批准证书》或《婴儿配方乳粉注册证书》。 特殊用途膳食用食品：指涉及医学用途或婴幼儿配方的食品。', 1, 521044, '普通膳食营养补充食品', 502043, '膳食营养补充食品');
INSERT INTO `eb_pay_component_cat` VALUES (517048, '收纳技巧', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 378005, '生活兴趣', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (517049, '自媒体运营', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、若涉及学历、技能证书，需提供2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (517050, '方案策划', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、若涉及学历、技能证书，需提供2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (517054, '其他金工', '1、需提供申请主体《营业执照》（经营范围包括销售黄金制品等） 2、需提供1款由国/省/市级质监局或同级别检测机构出具的完整的相关质检/检测报告。报告需包含：① CMA或CNAS标识；② 商标/商品图、检测单位、商品成分各含量鉴定结论', 1, '', 0, 378137, '黄金', 378136, '珠宝首饰');
INSERT INTO `eb_pay_component_cat` VALUES (517055, '优惠券', '《营业执照》，经营范围包含“票务代理”', 1, '', 0, 496042, '票务', 530004, '出行与交通');
INSERT INTO `eb_pay_component_cat` VALUES (517056, '瑜伽', '《营业执照》（经营范围包含运动类、健身等相关项目）', 1, '', 0, 428007, '本地玩乐', 128209, '旅游休闲');
INSERT INTO `eb_pay_component_cat` VALUES (521001, '保险', '需提供保险机构主体以下资质（10选1）： 1、《保险公司法人许可证》； 2、《经营保险业务许可证》 ；3、《保险营销服务许可证》； 4、《经营保险代理业务许可证》（业务范围为“全国”）； 5、《经营保险经纪业务许可证》（业务范围为“全国”）； 6、《经营保险公估业务许可证》或《经营保险公估业务备案》 （业务范围为“全国”）；7、《经营保险资产管理业务许可证》 ；8、银行类主体《保险兼业代理业务许可证》 ；9、《保险许可证》；10、《保险中介许可证》', 1, '（选填）请商详中说明投保须知和理赔流程', 2, 524003, '金融服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (521034, '餐饮预付卡', '需提供： ①发卡方单用途预付卡备案的证明文件；  ②发卡企业向备案机关提交的包含该入驻商家（售卡单位）的售卡企业清单及承诺函（入驻商家为发卡方无需提供此项）； ③卡券使用门店的《食品经营许可证》（经营范围需含餐饮制作相关项目）扫描件。', 1, '', 0, 527035, '餐饮', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (521035, '男士喷雾', '1、如主体为生产商，售卖国内商品需提供：①《化妆品生产许可证》； 2、如主体为进口商，售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料； （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '国产：国产非特殊用途化妆品备案（网上备案的电子凭证）或者国产特殊用途化妆品卫生许可批件； 进口：进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 1, 6871, '男士面部护肤', 6870, '美妆护肤');
INSERT INTO `eb_pay_component_cat` VALUES (521036, '男士眼膜', '1、如主体为生产商，售卖国内商品需提供：①《化妆品生产许可证》； 2、如主体为进口商，售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料； （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '国产：国产非特殊用途化妆品备案（网上备案的电子凭证）或者国产特殊用途化妆品卫生许可批件； 进口：进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 1, 6871, '男士面部护肤', 6870, '美妆护肤');
INSERT INTO `eb_pay_component_cat` VALUES (521037, '眉毛雨衣', '1、如主体为生产商，售卖国内商品需提供：①《化妆品生产许可证》； 2、如主体为进口商，售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料； （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '国产：国产非特殊用途化妆品备案（网上备案的电子凭证）或者国产特殊用途化妆品卫生许可批件； 进口：进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 1, 6911, '香水彩妆', 6870, '美妆护肤');
INSERT INTO `eb_pay_component_cat` VALUES (521038, '喉鼻护理', '售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料。 （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '（选填）若为国产特殊用途化妆品，需提供国产特殊用途化妆品卫生许可批件； 若为进口化妆品，需提供进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 2, 1046, '身体护理', 1001, '个人护理');
INSERT INTO `eb_pay_component_cat` VALUES (521039, '手部护理', '售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料。 （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '（选填）若为国产特殊用途化妆品，需提供国产特殊用途化妆品卫生许可批件； 若为进口化妆品，需提供进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 2, 1046, '身体护理', 1001, '个人护理');
