INSERT INTO `eb_pay_component_cat` VALUES (521048, '美容美发', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 378005, '生活兴趣', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (521049, '驾驶技能', '1、 提交线下门店信息，包括每家门店及培训场地地址信息，每家门店外观和培训场地照片；（门头照片应为实拍图，同时能看出明显品牌logo）。 2、 非驾考平台型的店铺需取得《道路运输经营许可证》；驾考平台型店铺，需取得被代理驾校的委托招生合同或委托招生授权书，以及被代理驾校的《道路运输经营许可证》。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (521051, '配镜服务', '需提供：验光人员职业资格证书以及验光设备焦度计、验光仪的年度检定证书。', 1, '', 0, 521050, '便民服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (521052, '酒吧', '1、 《营业执照》。 2、 《公共场所卫生许可证》。 3、 《娱乐场所经营许可证》。 4、 《酒类经营许可证》或《食品经营许可证》。', 1, '', 0, 428007, '本地玩乐', 128209, '旅游休闲');
