INSERT INTO `eb_pay_component_cat` VALUES (524035, '煲仔饭', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, '（选填）若经营清真食品，需提供生产厂商的《清真食品生产经营许可证》或相关证件', 2, 527038, '半成品菜/方便菜', 6625, '生鲜');
INSERT INTO `eb_pay_component_cat` VALUES (524036, '菌/菇/酵素', '需提供： 《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》；注：自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品））', 1, '1、2选1：①  需提供生产商在当地质量技术监督局进行的食品安全企业标准备案，证明产品可以以普通食品身份进入市场。② 《国产保健食品批准证书》 2、如涉及特殊用途膳食用食品的，需提供《国产特殊医学用途配方食品批准证书》或《婴儿配方乳粉注册证书》。 特殊用途膳食用食品：指涉及医学用途或婴幼儿配方的食品。', 1, 521044, '普通膳食营养补充食品', 502043, '膳食营养补充食品');
INSERT INTO `eb_pay_component_cat` VALUES (524037, '舞蹈表演', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 378005, '生活兴趣', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (524038, '职业发展/人力资源/管理营销', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍。 2、①如提供线上教育服务，需提供《ICP许可证》或ICP备案，若ICP备案资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、若涉及学历、技能证书，需提供2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (524039, '财税法培训', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 380003, '学历资格/职业技能培训', 381003, '教育培训');
