INSERT INTO `eb_pay_component_cat` VALUES (525032, '定妆喷雾', '1、如主体为生产商，售卖国内商品需提供：①《化妆品生产许可证》； 2、如主体为进口商，售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料； （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '国产：国产非特殊用途化妆品备案（网上备案的电子凭证）或者国产特殊用途化妆品卫生许可批件； 进口：进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 1, 6911, '香水彩妆', 6870, '美妆护肤');
