INSERT INTO `eb_pay_component_cat` VALUES (525045, '日语', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。 3、2选1：① 区、县级教育部门颁发的《民办学校办学许可证》；加营业执照（经营范围中应包含“教育培训”）或《民办非企业单位法人证书》，②《事业单位法人证书》（适用公立学校）。', 1, '', 0, 517051, '语言培训', 381003, '教育培训');
