INSERT INTO `eb_pay_component_cat` VALUES (526005, '高段位奶粉', '1、国产商品需提供：申请主体的《食品经营许可证》或《食品生产许可证》或《预包装食品销售备案凭证》。 2、进口商品需提供：①申请主体的《食品经营许可证》或《预包装食品销售备案凭证》；②近一年内的《出入境检验检疫证明》或《出入境检验检疫卫生证书》；③供货协议或采购合同等材料。 （注：①若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料；②自贸区企业若无法提供《食品经营许可证》，需要提供营业执照（经营范围需包含食品经营（预包装食品）））', 1, '商品标题需说明奶粉适用范围、婴幼儿奶粉需注明奶粉段位或适用年龄段', 2, 378056, '奶粉', 6153, '母婴');
INSERT INTO `eb_pay_component_cat` VALUES (526031, '喷雾', '1、如主体为生产商，售卖国内商品需提供：①《化妆品生产许可证》； 2、如主体为进口商，售卖进口商品需提供：①《出入境检验检疫证明》或《出入境检验检疫卫生证书》；②供货协议或采购合同等材料； （注：若申请主体为办理出入境检验证的收货人，则无需提供供货协议或采购合同等材料）', 2, '国产：国产非特殊用途化妆品备案（网上备案的电子凭证）或者国产特殊用途化妆品卫生许可批件； 进口：进口非特殊用途化妆品备案（网上备案的电子凭证）或者进口特殊用途化妆品卫生许可批件。', 1, 6896, '面部护肤', 6870, '美妆护肤');
