INSERT INTO `eb_pay_component_cat` VALUES (527059, '两性关系', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 510037, '情感心理', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (527060, '心理成长', '1、 需填写《产品经营说明书》注明线上/线下授课，主营类目及主推产品介绍 2、①如提供线上教育服务，需提供ICP备案（网络内容提供商备案）资质，若ICP备案（网络内容提供商备案）资质主办单位名称不在授权链上，需加盖主办单位红色公章，或提交关系证明/签署协议；②如线下授课，需提供线下门店照及门店场地证明（场地和校舍产权证明或合法规范的租赁协议书）。', 1, '', 0, 510037, '情感心理', 381003, '教育培训');
INSERT INTO `eb_pay_component_cat` VALUES (527061, '搬家', '1、 《营业执照》（经营范围包含家政服务等相关项目）。 2、 《道路运输经营许可证》。 3、 《车辆营运证》。 4、 若为平台型商家需提供ICP许可证或ICP备案证。', 1, '服务内容标准化，商品必须完整描述服务名称，具体包含的服务内容，商品详情须明确描述有效期，使用注意事项等内容。', 2, 377101, '家政', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (527062, '睫毛卷翘器', '', 0, '根据相关法律法规及平台运营规则，请上传《国家强制性产品认证证书》（CCC安全认证证书）', 2, 524026, '个护仪器', 1001, '个人护理');
INSERT INTO `eb_pay_component_cat` VALUES (527063, '亲子游玩', '1、旅行社总社需提供：① 《旅行社业务经营许可证》；② 旅行社责任险保险单 。 2、旅行社分社需提供：① 旅行社分社备案登记证明； ② 旅行社责任险保险单（若为总社统一购买提供总社旅行社责任险保险单）；③ 总社的《旅行社业务经营许可证》； ④旅行社分社和总社补充协议（如：由总社出具的知情同意责任书）。 3、旅行社若经营“境外一日游/多日游”“潜水”、“境外玩乐套餐”、“接送（机场/点对点/拼车）”类目，除提供上述资质外，还须提供至少一份与实际服务提供方的有效合作协议。', 1, '如涉及餐饮服务，需提供：《食品经营许可证》、《食品流通许可证》、《小餐饮登记》（任一）或其他同等效力证件。', 2, 525002, '旅游度假', 128209, '旅游休闲');
INSERT INTO `eb_pay_component_cat` VALUES (527065, '密室', '1、 《营业执照》。 2、 《娱乐场所经营许可证》。', 1, '', 0, 428007, '本地玩乐', 128209, '旅游休闲');
INSERT INTO `eb_pay_component_cat` VALUES (529031, '充电服务', '需提供①营业执照经营范围包含：汽车充电，电动车充电相关关键字 ；②需要提供电力相关公共事业部门授权或合作协议，或是提供电力公司授权或合作协议', 1, '', 0, 502033, '充电服务', 530004, '出行与交通');
