INSERT INTO `eb_pay_component_cat` VALUES (529051, '机票', '1、航空公司主体，需提供①《公共航空运输企业经营许可证》；② 《ICP许可证》。 2、  非航空主体，需提供：①《营业执照》经营范围包含：机票销售代理业务或相同意思表示；② 与航空公司的合作协议/授权代理销售协议；③《ICP许可证》。', 1, '', 0, 496042, '票务', 530004, '出行与交通');
