INSERT INTO `eb_pay_component_cat` VALUES (530005, '顺风车（拼车）', '需提供（3选1）： 1、政府交通管理部门备案证明；  2、客运公司：《道路运输经营许可证》（经营范围含客运）；  3、政府指定的联网售票平台：政府交通管理部门的联网售票许可', 1, '', 0, 494002, '顺风车（拼车）', 530004, '出行与交通');
