INSERT INTO `eb_pay_component_cat` VALUES (530007, '宽带缴费', '运营商主体：需提供《基础电信业务经营许可证》 非运营商主体：①提供与市级以上移动运营商（电信/联通需提供省级以上）的代理合同或合作协议等正规渠道证明②运营商合作协议中授权业务范围必须体现“可开展宽带充值或缴费业务”③提交与合作协议对应运营商系统对接的相关凭证，包括但不限于系统对接截图、接口报文截图等。', 1, '', 0, 1966, '通信服务', 377078, '生活服务');
INSERT INTO `eb_pay_component_cat` VALUES (530039, '居民用电', '电力机构主体： 申请主体为电力相关公共事业部门，且营业执照经营范围包含公共事业的电力经营和收费相关业务。 售电公司： 需提供：①申请主体的《售电公司信用承诺书》；②申请主体在“信用中国”网站或电力交易平台网站的备案公示。', 1, '', 0, 423003, '生活缴费', 377078, '生活服务');
