-- Records of eb_pay_component_cat
-- ----------------------------

-- ----------------------------
-- Table structure for eb_pay_component_delivery_company
-- ----------------------------
DROP TABLE IF EXISTS `eb_pay_component_delivery_company`;
CREATE TABLE `eb_pay_component_delivery_company`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `delivery_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '快递公司id',
  `delivery_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '快递公司名称',
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除 0未删除 1删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 600 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '组件快递公司表(视频号)' ROW_FORMAT = Dynamic;

